import React,{useState} from 'react';
import Data from './Data';
import Header from './Header';
// import kurti1 from './images/kurti1';
// import kurti_2 from './images/kurti_2';
// import kurti_3 from './images/kurti_3';
// import kurti_4 from './images/kurti_4';

function Main(){
	const [data1,setdata1]=useState(Data);
	return(
	<>
	<Header/>
	{data1.map((item=>{
		return(
		<>
		<div class="container " className="main_content" >
		<div class="row">
		<div class="col-sm-3">
		<img key={item.id} src={item.img} className="img2"/>
		<h1 key={item.id}>{item.title}</h1>
		<button type="button" class="bg-primary" key={item.id}>{item.desc}></button>
		</div>
		</div>
		</div>
		</>
		);
	}))}

	</>
	);
}



export default Main;
